    Chain.prototype = {

        /**
         * 将获取到的json数据处理，转化成html数据
         * @param level
         * @param aUpId
         * @return {string}
         */
        getArea: function (level, aUpId) {
            var _this = this,
                _level = level || 1,                // 地区的等级
                _aUpId = aUpId || [],               // 上级城市的编码
                _data = _this.areaJSON,             // 地区json数据
                _html = '';                         // 拼装的html

            // 分等级获取数据
            switch (_level) {
                case 1:
                    for(var i in _data) {
                        _html += '<option value="'+_data[i]['i']+'">'+_data[i]['n']+'</option>';
                    }
                    break;
                case 2:
                    for(var i in _data) {
                        if(_data[i]['i'] == _aUpId[0] ){
                            var _cityJSON = _data[i]['c'];      // 省下的所有市信息
                            for (var cityId in _cityJSON) {
                                _html += '<option value="'+_cityJSON[cityId]['i']+'">'+_cityJSON[cityId]['n']+'</option>';
                            }
                        }
                    }
                    break;
                case 3:
                    for(var i in _data) {
                        for(var i in _data) {
                            if(_data[i]['i'] == _aUpId[0] ){
                                var _cityJSON = _data[i]['c'];      // 省下的所有市信息

                                for( var cityId in _cityJSON){
                                    if (_cityJSON[cityId]['i'] == _aUpId[1]) {
                                        var _countryJSON = _cityJSON[cityId]['c'];
                                        for (var countryId in _countryJSON) {
                                            _html += '<option value="'+_countryJSON[countryId]['i']+'">'+_countryJSON[countryId]['n']+'</option>';
                                        }
                                    }
                                }
                            }
                        }
                        break;
                    }
                    break;

            }
            return _html;
        },

        /**
         * 渲染HTML
         * @param elementId
         * @param level
         * @param aUpId
         */
        renderArea: function (elementId, level, aUpId) {
            var _this = this,
                _level = level || 1,
                _aUpId = aUpId || [],
                _$option = $('#'+elementId);
            if(_$option.find('option').length > 1){
                _$option.find('option:gt(0)').remove();
                _$option.find('option').after(_this.getArea(_level, _aUpId));
            } else {
                _$option.find('option').after(_this.getArea(_level, _aUpId));
            }

        },

        /**
         * 交互事件
         */
        event: function () {
            var _this = this;
            for(var i = 0, len = _this.options.defaultElement.length - 1; i < len; i++){
                (function(){
                    var j = i;
                    $('#'+_this.options.defaultElement[j]).on('change', function(){
                        var _aTmp = [$('#'+_this.options.defaultElement[0]).find("option:selected").val()];

                        switch (j) {
                            case 0:     // 如果是选择第一个，那么清除最后一个选择的其他选择项
                                $('#'+_this.options.defaultElement[len]).find('option:gt(0)').remove();
                                _this.options.callback[0]();
                                break;

                            case 1:
                                _aTmp.push($(this).find("option:selected").val());
                                _this.options.callback[1]();
                                break;

                            case 2:
                                _this.options.callback[2]();
                                break;
                        }

                        _this.renderArea(_this.options.defaultElement[j+1], j+2, _aTmp);
                    });
                })();

            }
        },

        /**
         * 设置默认地区
         */
        setDefaultArea: function(aCityName) {
            var _this = this,
                _areaJSON = _this.areaJSON;
            if(aCityName.length){
                var _pHTML = '';            // 省的HTML标签
                for (var p in _areaJSON) {          // 获取省的信息
                    if(_areaJSON[p]['n'] == arguments[0][0]){
                        _pHTML += '<option value="'+_areaJSON[p]['i']+'" selected="selected">'+_areaJSON[p]['n']+'</option>';

                        // 获取其下的所有市
                        var _cityHTNL = '',
                            _cityJSON = _areaJSON[p]['c'];
                        for (var city in _cityJSON) {
                            if(_cityJSON[city]['n'] == arguments[0][1]){
                                _cityHTNL += '<option value="'+_cityJSON[city]['i']+'" selected="selected">'+_cityJSON[city]['n']+'</option>';

                                var _countryHTML = '',
                                    _countryJSON = _areaJSON[p]['c'][city]['c'];

                                for(var countryID in _countryJSON) {
                                    if(_countryJSON[countryID]['n'] == arguments[0][2]) {
                                        _countryHTML += '<option value="'+_countryJSON[countryID]['i']+'" selected="selected">'+_countryJSON[countryID]['n']+'</option>';
                                    } else {
                                        _countryHTML += '<option value="'+_countryJSON[countryID]['i']+'">'+_countryJSON[countryID]['n']+'</option>';
                                    }
                                }

                                $('#'+ _this.options.defaultElement[2]).find('option:gt(0)').remove();
                                $('#'+ _this.options.defaultElement[2]).find('option').after(_countryHTML);


                            } else {
                                _cityHTNL += '<option value="'+_cityJSON[city]['i']+'">'+_cityJSON[city]['n']+'</option>';
                            }
                        }
                        $('#'+ _this.options.defaultElement[1]).find('option:gt(0)').remove();
                        $('#'+ _this.options.defaultElement[1]).find('option').after(_cityHTNL);

                    } else {
                        _pHTML += '<option value="'+_areaJSON[p]['i']+'">'+_areaJSON[p]['n']+'</option>';
                    }
                }
                $('#'+ _this.options.defaultElement[0]).find('option:gt(0)').remove();
                $('#'+ _this.options.defaultElement[0]).find('option').after(_pHTML);

            }
        },

        /**
         * 初始化插件
         */
        init: function () {
            var _this = this;
            if(_this.options.defaultArea.length) {      // 显示默认值
                _this.setDefaultArea(_this.options.defaultArea);
            } else {
                _this.renderArea(_this.options.defaultElement[0],1,[]);
            }
            _this.event();
        }
    }



    $.mAreaChain = function (opts){
        new Chain(opts);
    }
